"   <h1>",
"    REFERENCES",
"   </h1>",
"   <ol id=\"reference\">",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"mobipreview.htm?42/53/43862/abstract/1\">",
"      Farer LS, Lowell AM, Meador MP. Extrapulmonary tuberculosis in the United States. Am J Epidemiol 1979; 109:205.",
"     </a>",
"    </li>",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"mobipreview.htm?42/53/43862/abstract/2\">",
"      Dasgupta A, Singh N, Bhatia A. Abdominal tuberculosis: a histopathological study with special reference to intestinal perforation and mesenteric vasculopathy. J Lab Physicians 2009; 1:56.",
"     </a>",
"    </li>",
