var title_f42_53_43868="Functional recovery after SCI by level";
var content_f42_53_43868=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEURO%2F73350&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEURO%2F73350&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Expected functional recovery following complete spinal cord injury by spinal level",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Spinal level",
"       </td>",
"       <td class=\"subtitle1\">",
"        Activities of daily living",
"       </td>",
"       <td class=\"subtitle1\">",
"        Mobility/locomotion",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        C1-C4",
"       </td>",
"       <td>",
"        <p>",
"         Feeding possible with balanced forearm orthoses",
"        </p>",
"        <p>",
"         Computer access by tongue, breath, voice controls",
"        </p>",
"        <p>",
"         Weight shifts with power tilt and recline chair",
"        </p>",
"        <p>",
"         Mouth stick use",
"        </p>",
"       </td>",
"       <td>",
"        Operate power chair with tongue, chin, or breath controller",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        C5",
"       </td>",
"       <td>",
"        <p>",
"         Drink from cup, feed with static splints and setup",
"        </p>",
"        <p>",
"         Oral/facial hygiene, writing, typing with equipment",
"        </p>",
"        <p>",
"         Dressing upper body possible",
"        </p>",
"        <p>",
"         Side-to-side weight shifts",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         Propel chair with hand rim projections short distances on smooth surfaces",
"        </p>",
"        <p>",
"         Power chair with hand controller",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        C6",
"       </td>",
"       <td>",
"        <p>",
"         Feed, dress upper body with setup",
"        </p>",
"        <p>",
"         Dressing lower body possible",
"        </p>",
"        <p>",
"         Forward weight shifts",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         Bed mobility with equipment",
"        </p>",
"        <p>",
"         Level surface transfers with assistance",
"        </p>",
"        <p>",
"         Propel indoors with coated hand rims",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        C7",
"       </td>",
"       <td>",
"        Independent feeding, dressing, bathing with adaptive equipment, built-up utensils",
"       </td>",
"       <td>",
"        <p>",
"         Independent bed mobility, level surface transfers",
"        </p>",
"        <p>",
"         Wheelchair use outdoors (power chair for school or work)",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        C8",
"       </td>",
"       <td>",
"        <p>",
"         Independent in feeding, dressing, bathing",
"        </p>",
"        <p>",
"         Bowel and bladder care with setup",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         Propel chair, including curbs and wheelies",
"        </p>",
"        <p>",
"         Wheelchair-to-car transfers",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        T1",
"       </td>",
"       <td>",
"        Independent in all self-care",
"       </td>",
"       <td>",
"        Transfer from floor to wheelchair",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        T2-L1",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        Stand with braces for exercise",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        L2",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        <p>",
"         Potential for swing-to gait with long leg braces indoors",
"        </p>",
"        <p>",
"         Use of forearm crutches",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        L3",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        <p>",
"         Potential for community ambulation",
"        </p>",
"        <p>",
"         Potential for ambulation with short leg braces",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        L4-S1",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"       <td>",
"        Potential for ambulation without assistive devices",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Physical Medicine and Rehabilitation, 2nd ed, Randall Braddom (ED), WB Saunders Company, 2000. Copyright &copy;2000 Elsevier.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
